import React from 'react'
import styled from 'styled-components'

const AnchorElem = styled.a`

`

function Anchor ({href, target, children}) {
    return(
        <AnchorElem
            href={href}
            target={target}
        >
            {children}
        </AnchorElem>
    )
}

export default Anchor
